var b="url",c="01__کارتابل_ماموریت_خارجی_مامور_.html",d="generationDate",e=new Date(1753683981734.23),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="v",s="a",t="nz",u="tash1",v="dymali",w="dykhaz",x="mopay",y="mopayt",z="nz2",A="page",B="packageId",C="23370870c5414c2ca578cd22b65f2a5f",D="type",E="Axure:Page",F="01. کارتابل ماموریت خارجی(مامور)",G="notes",H="Page Overview",I="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#F60068;\">فرم 01. کارتابل ماموریت خارجی(مامور)</span></p>",J="annotations",K="fn",L="1",M="ownerId",N="c0a50dc252bc45c59e06bbf117c5694d",O="label",P="(Shape)",Q="Note",R="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:rgba(32, 31, 79, 0.988235294117647);\">در صورت دریافت پیام جدید از سوی واحد تشریفات، مامور به فرم &quot;</span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#F60068;\">12. حکم ماموریت خارجی(مامور)</span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:rgba(32, 31, 79, 0.988235294117647);\">&quot; منتقل گردد</span></p>",S="2",T="c7a6b5ad9d8549a481e814ae6bd085aa",U="جزئیات",V="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">پس از صدور حکم ماموریت، مامور قادر به مشاهده حکم ماموریت و جزئیات آن باشد</span></p>",W="3",X="2d667c1bf8e945f2b4957f0f570b745e",Y="ماموریت خارجی",Z="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#831AB3;\">با ثبت هر درخواست ماموریت خارجی، اطلاعات مرتبط در جدول &quot;ماموریت خارجی&quot; درج گردد</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#3310DD;\">چنانچه ماموریت ثبت شده دارای چند مقصد می باشد جزئیات مربوط به مقصد اول در جدول &quot;ماموریت خارجی&quot;درج گردد و جهت مشاهده مقاصد دیگر ماموریت، تمام مقاصد ماموریت از ستون &quot;جزئیات&quot; گزینه &quot;نمایش&quot;&nbsp; جهت مامور قابل مشاهده باشد</span></p>",ba="4",bb="02b77db10b5448f2b30feba3c9ff0b29",bc="وضعیت",bd="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">با هر تغییر وضعیت بر روی درخواست ثبت شده، فیلد &quot;وضعیت&quot; برای ماموریت خارجی مرتبط بروزرسانی گردد</span></p>",be="5",bf="d74d364de72f422cb7f999d84f518c1e",bg="درخواست ماموریت خارج",bh="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">جهت ثبت درخواست ماموریت خارجی از این گزینه استفاده گردد</span></p>",bi="6",bj="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#7B1717;\">ثبت درخواست ماموریت خارجی برای کارکنان در دسترس باشد اما صدور حکم ماموریت منوط به تایید توسط سلسله مراتب تعیین شده در مدل فرایند می باشد</span></p>",bk="7",bl="955b0a2fb65d45b7baeb45d439e9b1e0",bm="کارتابل کارکنان",bn="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#A81780;\">کلیه درخواست های ثبت شده ماموریت خارجی، اطلاع رسانی، رهگیری آن، دریافت جزئیات و احکام ماموریت از طریق کارتابل ماموریت خارجی جهت کارکنان در دسترس باشد</span></p>",bo="style",bp="baseStyle",bq="627587b6038d43cca051c114ac41ad32",br="pageAlignment",bs="center",bt="fill",bu="fillType",bv="solid",bw="color",bx=0xFFFFFFFF,by="image",bz="imageAlignment",bA="near",bB="imageRepeat",bC="auto",bD="favicon",bE="sketchFactor",bF="0",bG="colorStyle",bH="appliedColor",bI="fontName",bJ="Applied Font",bK="borderWidth",bL="borderVisibility",bM="borderFill",bN=0xFF797979,bO="cornerRadius",bP="cornerVisibility",bQ="outerShadow",bR="on",bS=false,bT="offsetX",bU=5,bV="offsetY",bW="blurRadius",bX="spread",bY="r",bZ=0,ca="g",cb="b",cc=0.349019607843137,cd="adaptiveStyles",ce="interactionMap",cf="diagram",cg="objects",ch="id",ci="955b0a2fb65d45b7baeb45d439e9b1e0",cj="friendlyType",ck="Rectangle",cl="vectorShape",cm="styleType",cn="visible",co=true,cp="'B Yekan Regular', 'B Yekan', sans-serif",cq="fontWeight",cr="400",cs="foreGroundFill",ct=0xFFF60068,cu="opacity",cv=1,cw=1842,cx=70,cy="4b7bfc596114427989e10bb0b557d0ce",cz="location",cA="x",cB="y"